import React, { useEffect, useState } from "react";

export default function EvaluatorTable() {
  const [applications, setApplications] = useState([]);
  const [userState, setUserState] = useState(null);
  const role = localStorage.getItem("role");
  const email = localStorage.getItem("email");

  useEffect(() => {
    if (role !== "EVALUATOR") return;

    // Fetch evaluator's state from employee table
    fetch(`http://localhost:5001/employee/state?email=${email}`)
      .then((res) => res.json())
      .then((data) => setUserState(data.state))
      .catch((err) => console.error(err));
  }, [role, email]);

  useEffect(() => {
    fetch("http://localhost:5001/orders/all")
      .then((res) => res.json())
      .then((data) => setApplications(data))
      .catch((err) => console.error(err));
  }, []);

  const handleApprove = async (id) => {
    await fetch(`http://localhost:5001/orders/approve/${id}`, { method: "PUT" });
    setApplications((prev) =>
      prev.map((app) =>
        app.id === id ? { ...app, status: "APPROVED" } : app
      )
    );
  };

  const handleReject = async (id) => {
    await fetch(`http://localhost:5001/orders/reject/${id}`, { method: "PUT" });
    setApplications((prev) =>
      prev.map((app) =>
        app.id === id ? { ...app, status: "REJECTED" } : app
      )
    );
  };

  const filteredApplications =
    role === "EVALUATOR" && userState
      ? applications.filter((app) => app.location === userState)
      : applications;

  return (
    <div>
      <h2>Evaluator Applications</h2>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Name</th>
            <th>Spices</th>
            <th>Experience</th>
            <th>Location</th>
            <th>Status</th>
            {role === "EVALUATOR" ? <th>Actions</th> : null}
          </tr>
        </thead>
        <tbody>
          {filteredApplications.map((app) => (
            <tr key={app.id}>
              <td>{app.name}</td>
              <td>{app.spices}</td>
              <td>{app.experience}</td>
              <td>{app.location}</td>
              <td>{app.status}</td>
              {role === "EVALUATOR" ? (
                <td>
                  <button onClick={() => handleApprove(app.id)}>Approve</button>
                  <button onClick={() => handleReject(app.id)}>Reject</button>
                </td>
              ) : null}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
